import React from 'react';
import { StyleSheet, Text, View, Button, Image, TouchableHighlight, TouchableOpacity } from 'react-native';
import { useNavigation } from "@react-navigation/native";
import { ImageBackground } from 'react-native-web';

const Main = () => {

    const navigation = useNavigation();

    return (
        
        <View style = {styles.container}>

            <Text>Iniciar Sesion como</Text>

            <Button text={'Medico'} onPress={() => navigation.navigate('Login')}/>
            <Button text={'Paciente'} onPress={() => navigation.navigate('Login')}/>

            <Button text={'¿No tienes cuenta? Regístrate'} onPress={() => navigation.navigate('Register')}/>
            
        </View>
    )
}

const styles = StyleSheet.create({
    container: {
        alignItems: 'center',
        justifyContent: 'center',
        flex:1
    }
  });

export default Main;
